INSERT INTO foreign_data (id, flavorText, language, multiverseid, name, text, type, uuid) VALUES (73845, '', 'Japanese', 444328, 'リッチの騎士、ジョス・ヴェス', replace('キッカー{5}{B}（あなたはこの呪文を唱えるに際し、追加で{5}{B}を支払ってもよい。）\n威迫\nリッチの騎士、ジョス・ヴェスが戦場に出たとき、これがキッカーされていた場合、威迫を持つ黒の２/２のゾンビ・騎士・クリーチャー・トークンを８体生成する。','\n',char(10)), '伝説のクリーチャー — ゾンビ・騎士', 'e6987065-ae64-5b6c-a4ed-4f94bd196c66');
INSERT INTO foreign_data (id, flavorText, language, multiverseid, name, text, type, uuid) VALUES (20337, '「どの次元にも、危険に立ち向かう者は必ずいる。」 ――ギデオン・ジュラ', 'Japanese', 442239, '英雄的行動', 'クリーチャー１体を対象とし、それをアンタップする。ターン終了時まで、それは＋２/＋２の修整を受けるとともに、このターン、それは追加のクリーチャーを１体ブロックできる。', 'インスタント', '36ec140e-8588-5daa-af1d-7638cee8c0ab');
INSERT INTO foreign_data (id, flavorText, language, multiverseid, name, text, type, uuid) VALUES (73264, '"In un mondo che sta guarendo io scrivo... Io, che non potrò mai guarire. Possa il mio ultimo dono essere un ricordo: tra mille pensieri perduti, scegline uno e rimembra il mio nome."', 'Italian', 444001, 'Poetessa Tragica', '{T}, Sacrifica la Poetessa Tragica: Riprendi in mano una carta incantesimo bersaglio dal tuo cimitero.', 'Creatura — Umano', '45502d58-d89c-5bf4-9b4b-c01ff3b6605b');

