INSERT INTO comments (Id, PostId, Score, Text, CreationDate, UserId, UserDisplayName) VALUES (24968, 14153, 8, 'The answer will depend on your problem at hand: are both types of error equally bad, or are (e.g.) false negatives way worse than false positives. For instance if you want to test for a disease that kills, you want to strongly avoid false negatives (because those people will die when you don''t pick up the presence of the disease with your test)', '2011-08-11 13:54:56.0', 4257, NULL);

