INSERT INTO postHistory (Id, PostHistoryTypeId, PostId, RevisionGUID, CreationDate, UserId, Text, Comment, UserDisplayName) VALUES (32573, 2, 11578, '9232202e-fc1f-439b-8ce5-5deaa1226907', '2011-06-04 22:39:01.0', 4624, 'I''m a bit stuck on the general concept and calculations of  iterated expectations. A simple example:\\n\\nE[E[Y|X]] = E[Y]\\n\\nI''m not sure how or why this is the case? I have a 3 line proof in my notes using densities and stuff but is there no ''quicker'' way. Especially in longer cases like (below) writing everything out is difficult. Are there tricks to spot? \\n\\nExample 2:\\n\\nVar[Y] = E[Y^2] - (E[Y])^2 (I get this line!)\\n= E[E[Y^2|X]] - {E[E[Y|X]]}^2 \\n= E[Var[Y|X]] + (E[Y|X])^2 - {E[E[Y|X]]}^2\\n= E[Var[Y|X]] + E[(E[Y|X])^2] - {E[E[Y|X]]}^2\\n= E[Var[Y|X]] + Var[E[Y|X]]\\n\\nI''m not at all sure how they go from line to line.\\n\\nI hope someone can help me out. Thanks.', '', '');

